script: |
  super -f text -I q864.spq | sort > q864.out

inputs:
  - name: q864.spq
    data: |
      SELECT col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - CAST ( - col1 AS INTEGER ) NOT BETWEEN + col0 AND ( col0 * - 34 - - ( - + 36 ) + + col1 );
  - name: tab1

outputs:
  - name: q864.out
    data: |
